import React, { Component } from 'react';

class Runtime extends Component {
  render() {
    return (
    	<div className="run-time">
    		<div className="row time-call">
    			<div className="col-5 runtime">
    				Call Time: 00:00:00
    			</div>
    		</div>
    	</div>
    );
  }
}

export default Runtime;
